import React from 'react';
import ChristianDrinking from '../images/team/ChristianDrinking.jpg';
import HeaderSection from './components/HeaderSection';
import Team from './components/Team';
import Beer from './components/beer';
import Platforms from './components/Platforms';
import Anchor from '../images/platforms/anchor.jpg';

const Home = () => {
  const rowStyle = {
    position: "absolute",
    transform: "translate(-50%, -50%)",
    left: '50%',
    top: '50%',
    boxShadow: "0 0 1rem #fff",
    zIndex: "-1"
  }

  return (
    <>
    <div className="card bg-dark text-white">
  <img src={require(`../images/booksandbrewskies/studio3.png`)} className="card-img" alt="..." />
  <div className="card-img-overlay">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
    <p className="card-text">Last updated 3 mins ago</p>
  </div>
  </div>
    </>
  )
}

export default Home;
